import React from 'react';
import { Link } from 'react-router-dom';

const Homepage = () => {
  return (
    <div className="home-hero">
      <h1>What's Happening?</h1>
      <h4>New to Twitta?</h4>
      <Link to="/signup" className="btn btn-primary">
        Sign Up Here
      </Link>
    </div>
  );
}

export default Homepage;
